import React, { Component } from 'react';


class Coin extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div>
                <button>Flip Coin!</button>
                <p>Out of NUMBER flips, there has been HEADS heads and TAILS tails.</p>
            </div>
        )
    }
}

export default Coin;
